import React, { createContext, useContext, useReducer } from 'react';


const initialState = {
    count: 0,
  };

const reducer = (state, action) => {
    switch (action.type) {
      case 'WATER_INCREMENT':
        return {
            count: state.count + 1
        };


      case 'VEGETATION_INCREMENT':
        return {
         count: state.count + 20
        };
      default:
        return state;
    }
  };  



  const incrementWater = () => ({ type: "WATER_INCREMENT" });
  const incrementVegetation = () => ({ type: "decrement" });

  const actions = dispatch => ({
    increase: () => dispatch(increment()),
    decrease: () => dispatch(decrement())
  });



  const AddOnButton = () => {
    const [state, dispatch] = useReducer(reducer, initialState);
    return (
      <div>
         <h1> Count: {state.count}</h1>
        <button onClick={() => dispatch({type: 'WATER_INCREMENT'})}><h2>WATER</h2></button>
        <button onClick={() => dispatch({type: 'VEGETATION_INCREMENT'})}><h2>VEGETATION</h2></button>

      </div>
    );
  };


export default AddOnButton;
